import { Text, View } from "react-native";
import Header from "../components/Header";
import Categories from "../components/Categories";

function Home() {
  return (
    <View style={{flex: 1}}>
      <Header title={'Inicio'}/>
      <Categories />
    </View>
  );
}

export default Home;
